import React from 'react';
import ReactDOM from 'react-dom';

import App from './App';
import './Grid';  //grid init file

import AppControl from './AppController';

import './scss/index.scss';

ReactDOM.render(<App />,document.getElementById('root'));

AppControl.init();  // app starts


document.getElementById("2121").classList.add("cur");
for (let i = 0; i < 20; i++) {
    for (let j = 0; j < 51; j++) {
        let a = i + 10;
        let b = j + 10;
        document.getElementById(a + "" + b).addEventListener("mouseenter",function(a,b){
            document.getElementById(a+""+b).classList.add("cur");

        });
    }
}
